import Button from "../ui/Button";
function Todo() {
  return (
    <li className="list-group-item">
      <span>Task 1</span>
      <div className="btn-group">
        <Button color="outline-info">
          <li className="fa-solid fa-toggle-on" />
        </Button>
        <Button color="outline-danger">
          <li className="fa-regular fa-trash-can" />
        </Button>
      </div>
    </li>
  );
}
export default Todo;
